import React from 'react';
import logo from '../images/logo.png';
import {Navbar} from 'react-bootstrap';


const PublicNavBar = () => {
  return (
    <Navbar bg="light" >
    <Navbar.Brand href="#home">
      <img
        alt=""
        src={logo}
        width="60"
        style={{color:"purple"}}
        className="d-inline-block"
      />{' '}
      MEMES
    </Navbar.Brand>

  </Navbar>

  )
}

export default PublicNavBar
